sys_variable_value.value:
(function execute(inputs, outputs) {

  var xml_payload;
  var grSysAtt = new GlideRecord('sys_attachment');
  grSysAtt.addQuery('table_name', 'ecc_queue'); // name of table whose record have attachment
  grSysAtt.addQuery('table_sys_id', 'b7b6ccbd1bbb95106e76da03b24bcb2e'); // sys_id of record having attachment
  grSysAtt.query();
  if (grSysAtt.get(inputs.attachment)) {
    var sa = new GlideSysAttachment();
    xml_payload = sa.getContent(grSysAtt);
  }

  var text = xml_payload;
  var xmlHelp = new global.XMLHelper(text);
  var x = xmlHelp.toObject();
  outputs.stdout = x.result.stdout;

})(inputs, outputs);

